import styled from 'styled-components';

export const HomeWidget=styled.div`
    margin:20px 10%;
    background:red;
    overflow:hidden;
`
export const HomeLeftWidget=styled.div`
    width:60%;
    float:left;
    background:blue;
    text-align:center;
    .HomeImg{
        height:280px;
        margin:0;
    }
`
export const HomeRightWidget=styled.div`
    width:40%;
    float:right;

`
